import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Button, CircularProgress } from "@material-ui/core";
import { Formik } from "formik";
import * as Yup from "yup";
import { ICart } from "../../redux/types/cart";
import { ICity } from "../../redux/types/city";

import FormCity from "../../pages/auth/FormCity";

import { useDispatch, useSelector } from "react-redux";
import { RootState } from "../../redux/reducers";

import { addCart, getCart, getCity } from "../../redux/actions/admin";

import { Box, Container, FormControl, FormLabel, TextField, Typography } from "@mui/material";

import { useHistory } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        position: "absolute",
        top: "0",
        left: "0",
        width: "100%",
        minHeight: "100vh",
    },
    formControl: {
        margin: theme.spacing(1, 0),
    },
    checkboxWrapper: {
        display: "flex",
        justifyContent: "flex-start",
        marginTop: theme.spacing(2),
    },
    textField: {
        margin: theme.spacing(1.5, 0),
        textAlign: 'left',
        fontSize: '13px',
        "& .MuiInputBase-root": {
            "& fieldset": {
                borderRadius: "10px",
            },
        },
    },
}));

interface IInitialValues {
    product: any;
    fullName: string;
    nameCompany: string;
    address: string;
    city: any;
    sdt: string;
    email: string;
}

const Cart: React.FC = (): JSX.Element => {
    const classes = useStyles();
    const history = useHistory();
    const dispatch = useDispatch();
    const [localItems, setLocalItems] = React.useState(JSON.parse(localStorage.getItem("productList")!) || []);
    const mapProductList = localItems.flatMap((arr: any) => arr)

    const [carts, setCarts] = React.useState<ICart[]>([]);
    const [cities, setCities] = React.useState<ICity[]>([]);
    const Cart = useSelector((state: RootState) => state.admin);

    const initialValues: IInitialValues = {
        product: mapProductList,
        fullName: "",
        nameCompany: "",
        address: "",
        city: "",
        sdt: "",
        email: "",
    };

    const onHandleSubmit = (values: IInitialValues, { setSubmitting }: any) => {
        dispatch(addCart({ ...values }, setSubmitting))
    };

    const validationSchema = Yup.object({
        fullName: Yup.string().required("required!"),
        nameCompany: Yup.string().required("required!"),
        address: Yup.string().required("required!"),
        sdt: Yup.string().required("required!"),
        email: Yup.string().required("required!"),
    });

    React.useEffect(() => {
        dispatch(getCart());
    }, [dispatch]);

    React.useEffect(() => {
        dispatch(getCity());
    }, [dispatch]);

    React.useEffect(() => {
        setCities(() => Cart?.cities?.filter((city: any) => city._id));
    }, [Cart]);

    React.useEffect(() => {
        setCarts(() => Cart?.carts?.filter((cart: any) => cart._id));
    }, [Cart]);

    return (
        <Container style={{ maxWidth: 600 }}>

            <Formik
                initialValues={initialValues}
                validationSchema={validationSchema}
                onSubmit={onHandleSubmit}
            >
                {({ isSubmitting, handleSubmit, values, handleChange, handleBlur, errors, touched }) => (
                    <form noValidate onSubmit={handleSubmit}>
                        <Box display={"flex"}
                            flexDirection={'column'}
                            justifyContent={'center'}
                            alignItems={'center'}
                            style={{ backgroundColor: 'white', padding: '40px 0px', borderRadius: '20px' }}>

                            <Typography style={{ fontWeight: "bold", fontSize: "18px", margin: 20 }} >
                                THANH TOÁN
                            </Typography>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", margin: "10px 0" }}>
                                    Họ tên
                                </FormLabel>

                                <TextField
                                    style={{ width: 300 }}
                                    fullWidth
                                    variant={'outlined'}
                                    name='fullName'
                                    value={values.fullName}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                    placeholder='Nhập họ tên'
                                    inputProps={{
                                        style: {
                                            fontSize: '12px',
                                        }
                                    }}
                                    helperText={touched.fullName ? errors.fullName : ""}
                                    error={touched.fullName ? Boolean(errors.fullName) : false}
                                />
                            </FormControl>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", margin: "10px 0" }}>
                                    Tên công ty
                                </FormLabel>

                                <TextField
                                    style={{ width: 300 }}
                                    fullWidth
                                    variant={'outlined'}
                                    name='nameCompany'
                                    value={values.nameCompany}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                    placeholder='Nhập tên công ty'
                                    inputProps={{
                                        style: {
                                            fontSize: '12px',
                                        }
                                    }}
                                    helperText={touched.nameCompany ? errors.nameCompany : ""}
                                    error={touched.nameCompany ? Boolean(errors.nameCompany) : false}
                                />
                            </FormControl>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", margin: "10px 0" }}>
                                    Địa chỉ
                                </FormLabel>
                                <TextField
                                    style={{ width: 300 }}
                                    fullWidth
                                    variant="outlined"
                                    name='address'
                                    value={values.address}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                    placeholder='Nhập địa chỉ'
                                    helperText={touched.address ? errors.address : ""}
                                    error={touched.address ? Boolean(errors.address) : false}
                                    inputProps={{
                                        style: {
                                            fontSize: '12px',
                                        }
                                    }}
                                />
                            </FormControl>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", marginTop: "5px" }}>Thành phố</FormLabel>
                                <FormCity isCity={true} />
                            </FormControl>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", margin: "10px 0" }}>
                                    Số điện thoại
                                </FormLabel>
                                <TextField
                                    style={{ width: 300 }}
                                    fullWidth
                                    variant="outlined"
                                    name='sdt'
                                    value={values.sdt}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                    placeholder='Nhập số điện thoại'
                                    helperText={touched.sdt ? errors.sdt : ""}
                                    error={touched.sdt ? Boolean(errors.sdt) : false}
                                    inputProps={{
                                        style: {
                                            fontSize: '12px',
                                        }
                                    }}
                                />
                            </FormControl>

                            <FormControl className={classes.formControl}>
                                <FormLabel style={{ fontWeight: "bold", fontSize: "14px", margin: "10px 0" }}>
                                    Địa chỉ email
                                </FormLabel>
                                <TextField
                                    style={{ width: 300 }}
                                    fullWidth
                                    variant="outlined"
                                    name='email'
                                    value={values.address}
                                    onChange={handleChange}
                                    onBlur={handleBlur}
                                    placeholder='Nhập email'
                                    helperText={touched.email ? errors.email : ""}
                                    error={touched.email ? Boolean(errors.email) : false}
                                    inputProps={{
                                        style: {
                                            fontSize: '12px',
                                        }
                                    }}
                                />
                            </FormControl>
                            <Box>
                                <Button
                                    type='submit'
                                    style={{
                                        color: "rgb(33, 43, 54)",
                                        height: "34px",
                                        width: "120px",
                                        fontSize: "12px",
                                        borderRadius: "4px",
                                        fontWeight: 500,
                                        textTransform: "capitalize",
                                        border: '1px solid rgb(33, 43, 54)',
                                        marginRight: 10
                                    }}
                                    disabled={isSubmitting}
                                >
                                    {isSubmitting ? <CircularProgress size='1rem' /> : "Đặt hàng"}
                                </Button>
                                <Button style={{
                                    color: "#FF6969",
                                    height: "34px",
                                    width: "120px",
                                    fontSize: "12px",
                                    fontWeight: 500,
                                    borderRadius: "4px",
                                    textTransform: "capitalize",
                                    border: '1px solid #FF6969',
                                }}
                                    onClick={history.goBack}
                                >Quay lại</Button>
                            </Box>
                        </Box>
                    </form>
                )}
            </Formik>

        </Container >

    );
};
export default Cart;
